import { Text, View } from "react-native";

const RepositoryItemDescription = ({ name, description, styles }) => {
  return (
    <View style={styles.container}>
      <Text>{name}</Text>
      <Text>{description}</Text>
    </View>
  );
};

export default RepositoryItemDescription;
